\section{Introduction}

Multiresolution decomposition is a well-established method in image processing and analysis. It allows to decompose a signal into different frequency bands or scales, each of which captures specific features of the signal. This is particularly useful when dealing with images that contain both fine details and coarse structures. In this context, the wavelet transform is a popular tool for multiresolution decomposition.

However, the classical wavelet transform is designed for regularly sampled data, such as images or signals sampled on a regular grid. Areal count data, on the other hand, are irregularly sampled and typically represent geographical phenomena, such as population counts or crime rates.

